/**
 * Contains one variant per dispatchable that can be called by an extrinsic.
 **/
export type PalletContractsCall =
  /**
   * Deprecated version if [`Self::call`] for use in an in-storage `Call`.
   **/
  | {
      tag: 'CallOldWeight';
      value: {
        dest: MultiAddress;
        value: bigint;
        gasLimit: bigint;
        storageDepositLimit?: bigint | undefined;
        data: Bytes;
      };
    }
  /**
   * Deprecated version if [`Self::instantiate_with_code`] for use in an in-storage `Call`.
   **/
  | {
      tag: 'InstantiateWithCodeOldWeight';
      value: {
        value: bigint;
        gasLimit: bigint;
        storageDepositLimit?: bigint | undefined;
        code: Bytes;
        data: Bytes;
        salt: Bytes;
      };
    }
  /**
   * Deprecated version if [`Self::instantiate`] for use in an in-storage `Call`.
   **/
  | {
      tag: 'InstantiateOldWeight';
      value: {
        value: bigint;
        gasLimit: bigint;
        storageDepositLimit?: bigint | undefined;
        codeHash: H256;
        data: Bytes;
        salt: Bytes;
      };
    }
  /**
   * Upload new `code` without instantiating a contract from it.
   *
   * If the code does not already exist a deposit is reserved from the caller
   * and unreserved only when [`Self::remove_code`] is called. The size of the reserve
   * depends on the instrumented size of the the supplied `code`.
   *
   * If the code already exists in storage it will still return `Ok` and upgrades
   * the in storage version to the current
   * [`InstructionWeights::version`](InstructionWeights).
   *
   * - `determinism`: If this is set to any other value but [`Determinism::Enforced`] then
   * the only way to use this code is to delegate call into it from an offchain execution.
   * Set to [`Determinism::Enforced`] if in doubt.
   *
   * # Note
   *
   * Anyone can instantiate a contract from any uploaded code and thus prevent its removal.
   * To avoid this situation a constructor could employ access control so that it can
   * only be instantiated by permissioned entities. The same is true when uploading
   * through [`Self::instantiate_with_code`].
   **/
  | {
      tag: 'UploadCode';
      value: { code: Bytes; storageDepositLimit?: bigint | undefined; determinism: PalletContractsWasmDeterminism };
    }
  /**
   * Remove the code stored under `code_hash` and refund the deposit to its owner.
   *
   * A code can only be removed by its original uploader (its owner) and only if it is
   * not used by any contract.
   **/
  | { tag: 'RemoveCode'; value: { codeHash: H256 } }
  /**
   * Privileged function that changes the code of an existing contract.
   *
   * This takes care of updating refcounts and all other necessary operations. Returns
   * an error if either the `code_hash` or `dest` do not exist.
   *
   * # Note
   *
   * This does **not** change the address of the contract in question. This means
   * that the contract address is no longer derived from its code hash after calling
   * this dispatchable.
   **/
  | { tag: 'SetCode'; value: { dest: MultiAddress; codeHash: H256 } }
  /**
   * Makes a call to an account, optionally transferring some balance.
   *
   * # Parameters
   *
   * * `dest`: Address of the contract to call.
   * * `value`: The balance to transfer from the `origin` to `dest`.
   * * `gas_limit`: The gas limit enforced when executing the constructor.
   * * `storage_deposit_limit`: The maximum amount of balance that can be charged from the
   * caller to pay for the storage consumed.
   * * `data`: The input data to pass to the contract.
   *
   * * If the account is a smart-contract account, the associated code will be
   * executed and any value will be transferred.
   * * If the account is a regular account, any value will be transferred.
   * * If no account exists and the call value is not less than `existential_deposit`,
   * a regular account will be created and any value will be transferred.
   **/
  | {
      tag: 'Call';
      value: {
        dest: MultiAddress;
        value: bigint;
        gasLimit: SpWeightsWeightV2Weight;
        storageDepositLimit?: bigint | undefined;
        data: Bytes;
      };
    }
  /**
   * Instantiates a new contract from the supplied `code` optionally transferring
   * some balance.
   *
   * This dispatchable has the same effect as calling [`Self::upload_code`] +
   * [`Self::instantiate`]. Bundling them together provides efficiency gains. Please
   * also check the documentation of [`Self::upload_code`].
   *
   * # Parameters
   *
   * * `value`: The balance to transfer from the `origin` to the newly created contract.
   * * `gas_limit`: The gas limit enforced when executing the constructor.
   * * `storage_deposit_limit`: The maximum amount of balance that can be charged/reserved
   * from the caller to pay for the storage consumed.
   * * `code`: The contract code to deploy in raw bytes.
   * * `data`: The input data to pass to the contract constructor.
   * * `salt`: Used for the address derivation. See [`Pallet::contract_address`].
   *
   * Instantiation is executed as follows:
   *
   * - The supplied `code` is instrumented, deployed, and a `code_hash` is created for that
   * code.
   * - If the `code_hash` already exists on the chain the underlying `code` will be shared.
   * - The destination address is computed based on the sender, code_hash and the salt.
   * - The smart-contract account is created at the computed address.
   * - The `value` is transferred to the new account.
   * - The `deploy` function is executed in the context of the newly-created account.
   **/
  | {
      tag: 'InstantiateWithCode';
      value: {
        value: bigint;
        gasLimit: SpWeightsWeightV2Weight;
        storageDepositLimit?: bigint | undefined;
        code: Bytes;
        data: Bytes;
        salt: Bytes;
      };
    }
  /**
   * Instantiates a contract from a previously deployed wasm binary.
   *
   * This function is identical to [`Self::instantiate_with_code`] but without the
   * code deployment step. Instead, the `code_hash` of an on-chain deployed wasm binary
   * must be supplied.
   **/
  | {
      tag: 'Instantiate';
      value: {
        value: bigint;
        gasLimit: SpWeightsWeightV2Weight;
        storageDepositLimit?: bigint | undefined;
        codeHash: H256;
        data: Bytes;
        salt: Bytes;
      };
    }
  /**
   * When a migration is in progress, this dispatchable can be used to run migration steps.
   * Calls that contribute to advancing the migration have their fees waived, as it's helpful
   * for the chain. Note that while the migration is in progress, the pallet will also
   * leverage the `on_idle` hooks to run migration steps.
   **/
  | { tag: 'Migrate'; value: { weightLimit: SpWeightsWeightV2Weight } };

export type PalletContractsWasmDeterminism = 'Enforced' | 'Relaxed';

